import { Outlet } from "react-router-dom";
import { Suspense } from "react";
import Header from "../../components/Header/Header";

const SharedLayout = () => {
  return (
    <Header>
      <main>
        <Suspense fallback={<div>loader..</div>}>
          <Outlet />
        </Suspense>
      </main>
    </Header>
  );
};

export default SharedLayout;
